                            By:
                        </div>
                    </div>
                <div>
                    Body:
                </div>
    
            </div>
    
            <button onClick={handleClick}>AuthorDetails</button>
            </>
            )
    }   
    
  async function getPostData(key) {
        axios.get(`https://jsonplaceholder.typicode.com/posts/${key}`) 
        .then((response) => {
            const postData = response.data;
            this.setState({ postData })
        })
        .catch(console.log)    
        return {
            postData
        } 
    }

    
export default Post;
